import React from 'react'

function Pagination({setPage, currentPage, pages}){

    if(pages===1) return null;

    let range = []

    if(currentPage < pages - 5){
        for (let i = pages; i < pages - 4; --i) {
            range.push(i);
          }
    }
    else{
        for (let i = currentPage; i < 4; ++i) {
            range.push(i);
          }
    }


    return (<div>
        <ul>
            {range.map( num => (
                {num}
            ))}
        </ul>
    </div>)
}

export default Pagination
